import React from 'react';
import './Menu.css'
import LocationLogo from '../../icons/location-icon.svg';
import GearLogo from '../../icons/gear.svg';
const Menu = () => {

  return(
    <nav className= "menu">
      <p className="heading-one">Send
        <span className="heading-two">News</span>
      </p>

      <p className="section-heading">
        <img className="section-img"
          src={LocationLogo}
          alt="location pin">
        </img>
      Local News
      </p>

      <p className="local-news">
        <img className="section-img"
          src={GearLogo}
          alt="location pin">
        </img>
      Technology
      </p>
    </nav>

  )
}

export default Menu;
